import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import "./AdminDashboard.css"; // For custom styling

function AdminDashboard() {
  const navigate = useNavigate();
  const [user, setUser] = useState({});

  useEffect(() => {
    const loggedInUser = JSON.parse(localStorage.getItem("user"));
    setUser(loggedInUser || { username: "Admin", role: "Administrator" });
  }, []);

  const handleViewClubs = () => navigate("/clubs");
  const handleViewEvents = () => navigate("/events");
  const handleViewResources = () => navigate("/resources");
  const handleShareThoughts = () => navigate("/share-thought");
  const handleViewUsers = () => navigate("/all-users");
  const handleCreateClub = () => navigate("/create-club");
  const handleCreateEvent = () => navigate("/create-event");

  const handleLogout = () => {
    localStorage.removeItem("token");
    localStorage.removeItem("user");
    navigate("/login");
  };

  return (
    <div className="dashboard">
      <div className="topbar">
        <div className="logo">Admin Dashboard</div>
        <div className="profile">
          <p>{user.username}</p>
          <p className="role">{user.role}</p>
        </div>
        <div className="actions">
          <button onClick={handleLogout} className="logout-btn">
            Logout
          </button>
        </div>
      </div>

      {/* Main Content Section */}
      <div className="content">
        <h1>Welcome, {user.username}</h1>
        <p>Explore the admin functionalities below:</p>

        {/* Cards Section */}
        <div className="dashboard-cards">
          <div className="card" onClick={handleViewClubs}>
            <div className="card-cover clubs-cover"></div>
            <div className="card-title">Clubs</div>
          </div>

          <div className="card" onClick={handleViewEvents}>
            <div className="card-cover events-cover"></div>
            <div className="card-title">Events</div>
          </div>

          <div className="card" onClick={handleViewResources}>
            <div className="card-cover resources-cover"></div>
            <div className="card-title">Resources</div>
          </div>

          <div className="card" onClick={handleShareThoughts}>
            <div className="card-cover share-thought-cover"></div>
            <div className="card-title">Share Thoughts</div>
          </div>

          <div className="card" onClick={handleViewUsers}>
            <div className="card-cover users-cover"></div>
            <div className="card-title">View All Users</div>
          </div>

          <div className="card" onClick={handleCreateClub}>
            <div className="card-cover create-club-cover"></div>
            <div className="card-title">Create Club</div>
          </div>

          <div className="card" onClick={handleCreateEvent}>
            <div className="card-cover create-event-cover"></div>
            <div className="card-title">Create Event</div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default AdminDashboard;
